import { useEffect, useState } from "react"
// import "./commerce.css"

function Free() {
  const [data, setData] = useState([])
  useEffect(() => {
    fetch(" http://localhost:3006/e-commerce")
      .then((res) => {
        return res.json()
      })
      .then((resp) => {
        setData(resp)
      })
  }, [])
  return (
   <div>
    <nav class="navbar bg-dark border-bottom border-body" data-bs-theme="dark" padding="5px"></nav>

    <div className="row my-2">
      {data.map((item) => (
        <div className="col-sm-3 mb-3">
        <div className="card h-100">

          <div className="card-body">
          <img src={item.img} className="mb-2" alt="kk" height="200px" width="100%"/>
            <h5 className="card-title">{item.name}</h5>
            <p className="card-text">{item.content}</p>
            <h4>Rs.{item.price}$</h4>
            <a href="#" className="btn btn-primary">ADD CART(+)</a>
          </div>

        </div>
        </div>

      ))}
    </div>
    </div>
  )
}
export default Free;
